import React, { Component } from 'react';
import {Container, Row, Col} from 'react-bootstrap'
import styles from './courseSelect.module.css'
import Tag from "./tag"
class CourseSelect extends Component {
  // Initialize the state
  constructor(props){
    super(props);
    this.state = {
      courselist: [["Music",100,"data:image/jpeg;base64,"],
      ["Dance",42,"data:image/jpeg;base64,"],
      ["Art",150,"data:image/jpeg;base64,"],
      ["Programming",300,"data:image/jpeg;base64,"],
      ["Chess",123,"data:image/jpeg;base64,"],
      ["Fitness",124,"data:image/jpeg;base64,"]],
    }
  }

  // Fetch the list on first mount
  componentDidMount() {
    this.getList();
  }

  // Retrieves the list of items from the Express app
  getList = () => {
    fetch('/api/getCourseList')
    .then(res => res.json())
    .then(list => this.setState({ courselist : list }))
  }

  toggleClassName  = () => {
    this.className = (this.className === `${styles.courseCol}`) ? `${styles.courseCol} border border-primary` : `${styles.courseCol}`;
  }
//border border-primary 
  getColList(courseList) {
    var rows = [];
    for (var i = 0; i < courseList.length; i+=3) {     
        rows.push(
          <div>
          <Row key={i}>
            <Col className={`${styles.courseCol}`} onClick={this.addRemCourse}><Tag name={this.state.courselist[i][0]} videos={this.state.courselist[i][1]} thumbnail={this.state.courselist[i][2]}></Tag></Col>
            <Col className={`${styles.courseCol}`}>{i+1 < courseList.length ? <Tag name={this.state.courselist[i+1][0]} videos={this.state.courselist[i+1][1]} thumbnail={this.state.courselist[i+1][2]}></Tag> : ''}</Col>
            <Col className={`${styles.courseCol}`}>{i+2 < courseList.length ? <Tag name={this.state.courselist[i+2][0]} videos={this.state.courselist[i+2][1]} thumbnail={this.state.courselist[i+2][2]}></Tag> : ''}</Col>
          </Row>
          <br />
          </div>
        );
    }

    
    return <div>{rows}</div>;
  }

  render() {
    const courseList = this.state.courselist;

    return (
      <div>
        {/* Check to see if any items are found*/}
        {courseList.length ? (
          <Container fluid>
              {this.getColList(courseList)}
          </Container>
        ) : (
          <div>
            <h2>No List Items Found</h2>
          </div>
        )
      }
      </div>
    );
  }
}

export default CourseSelect;
